const useStyles = makeStyles(theme => ({
  root: {
    width: "100%"
  },
  paper: {
    marginTop: theme.spacing(3),
    width: "100%",
    overflowX: "auto",
    marginBottom: theme.spacing(2)
  },
  table: {
    maxWidth: 650
  }
}));

export default function ManagersTeam(props) {
  const classes = useStyles();
  let counter = 1;
  const calculateTotal = (playerObj, playerNos, deleteplayer, oldPlayer) => {
    props.calculateTeamTotal(playerObj, playerNos, deleteplayer, oldPlayer);
  };

  return (
    <div className={classes.root}>
      <Paper className={classes.paper}>
        <Table
          className={classes.table}
          size="small"
          aria-label="a dense table"
        >
          <TableBody>
            {props.playerList.length > 0 &&
              props.playerList.map(plyr => (
                <TableRow
                  key={plyr.id + plyr.playerName}
                  style={{
                    height: "30",
                    padding: "0",
                    nmargin: "0",
                    background: plyr.modified === true ? "#00afec" : "white",
                    color: plyr.modified === true ? "white" : "black"
                  }}
                  secondary={true}
                >
                  <TableCell
                    align="left"
                    style={{
                      height: "08",
                      width: "0",
                      padding: "0",
                      nmargin: "0"
                    }}
                  >
                    <Box
                      display="flex"
                      flexWrap="nowrap"
                      justifyContent="flex-start"
                      p={-40}
                    >
                      {/* <Avatar
                        alt={`Avatar nÂ°${counter + 1}`}
                        src={"batsman.jpg"}
                        style={{ width: "1", padding: "0", margin: "0" }}
                      /> */}
                      {plyr.playerType === "Batsman" && counter !== 7 && (
                        <Avatar
                          src="data:image/png;base64,"
                          size={100}
                          backgroundColor="rgba(0,0,0,0)"
                          style={{ width: "1", padding: "0", margin: "0" }}
                        />
                      )}
                      {plyr.playerType === "AllRounder" && counter !== 7 && (
                        <Avatar
                          src="data:image/jpeg;base64,"
                          size={100}
                          backgroundColor="rgba(0,0,0,0)"
                          style={{ width: "1", padding: "0", margin: "0" }}
                        />
                      )}
                      {counter === 7 && (
                        <Avatar
                          src="data:image/jpeg;base64,"
                          size={100}
                          backgroundColor="rgba(0,0,0,0)"
                          style={{ width: "1", padding: "0", margin: "0" }}
                        />
                      )}

                      {plyr.playerType === "Bowler" && counter !== 7 && (
                        <Avatar
                          src="data:image/png;base64,"
                          size={100}
                          backgroundColor="rgba(0,0,0,0)"
                          style={{ width: "1", padding: "0", margin: "0" }}
                        />
                      )}
                    </Box>
                  </TableCell>
                  {/* <TableCell
                    align="left"
                    style={{
                      height: "20",
                      width: "0",
                      padding: "0",
                      nmargin: "0"
                    }}
                  >
                    {counter}
                  </TableCell> */}
                  <TableCell
                    align="left"
                    style={{
                      width: "0",
                      padding: "0",
                      nmargin: "0"
                    }}
                  >
                    {plyr.playerName}
                  </TableCell>
                  <TableCell
                    align="left"
                    style={{
                      width: "0",
                      padding: "0",
                      nmargin: "0"
                    }}
                  >
                    <Tooltip title="Points Scored" placement="top-start">
                      <Typography>
                        {plyr.points == null ? 0 : plyr.points}
                      </Typography>
                    </Tooltip>
                  </TableCell>
                  {/* <TableCell align="right">{plyr.playerType}</TableCell> */}
                  <TableCell align="left">
                    <MultipleSelect
                      PlayerType={counter === 7 ? "All" : plyr.playerType}
                      PlayerNo={counter++}
                      calculateTotal={calculateTotal}
                      useJson={true}
                      playerId={plyr.playerListId}
                      playerName={plyr.playerName}
                      playerError={plyr.error}
                    />
                  </TableCell>

                  {/* <TableCell align="left">{plyr.isActive}</TableCell> */}
                </TableRow>
              ))}
          </TableBody>
        </Table>
      </Paper>
    </div>
  );
}
